package dev.eths.legacytab.util;

import com.github.retrooper.packetevents.protocol.player.TextureProperty;
import com.github.retrooper.packetevents.util.MojangAPIUtil;
import lombok.AllArgsConstructor;
import lombok.Getter;

import java.util.Collections;
import java.util.HashMap;
import java.util.List;
import java.util.UUID;

@AllArgsConstructor
@Getter
public class Skin {

    @Getter private static final HashMap<UUID, TextureProperty> textureProperties = new HashMap<>();

    private final String value;
    private final String signature;

    public Skin(UUID uuid) {
        TextureProperty texture = MojangAPIUtil.requestPlayerTextureProperties(uuid).get(0);
        this.value = texture.getValue();
        this.signature = texture.getSignature();
    }
    /**
     * Checks if another skin matches this one
     * @param skin Skin
     * @return Matches
     */
    public boolean matches(Skin skin) {
        return value.equals(skin.getValue()) && signature.equals(skin.getSignature());
    }

    public static final Skin LIGHT_GRAY = new Skin(
            "",
            ""
    );

    public static final Skin RED = new Skin(
            "",
            ""
    );

    public static final Skin YELLOW_ICON = new Skin(
            "",
            ""
    );

    public static final Skin GREEN_ICON = new Skin(
            "",
            ""

    );

    public static final Skin DEAD = new Skin(
            "",
            ""
    );

    public static final Skin HUAHWI = new Skin("",
            ""
    );

    public static final Skin PRIVATE = new Skin("",
            ""
    );

    public static final Skin WARRIOR = new Skin("",
            ""
    );

    public static final Skin KRONA = new Skin("",
            ""

    );

    public List<TextureProperty> toTexture() {
        return Collections.singletonList(new TextureProperty(
                "textures",
                value,
                signature));
    }

}
